import Navbar from "../components/navbar/Navbar";
import Wallpaper from "../../src/utils/img/wallpaper.jpg";

function Home() {
    return (
        <div className="container-home">
            <Navbar />
            <img src={Wallpaper}/>
        </div>
    );
}

export default Home;
